import React from 'react';
import Pokemon from './Pokemon';

const PokemonList = props => {
    return <ul className='pokemonList'>
        {props.items.map((item,id) => {
            return <li key = {id}>
                <Pokemon 
                imageUrl = {item.url} 
                pokemonTitle ={item.name}
                types ={item.types}
                />
            </li>
        })}
    </ul>
}


export default PokemonList;
